      title: 'mens',
      imageUrl: 'https://i.ibb.co/R70vBrQ/men.png',
      size: 'large',
      id: 5,
      linkUrl: '',
    },
  ],
}

const directoryReducer = (state = intialState, action) => {
  switch (action.type) {
    default:
      return state
  }
}
